import{_ as e,c as o,b0 as t,o as l}from"./chunks/framework.D6xZgKGL.js";const d=JSON.parse('{"title":"3月1日","description":"","frontmatter":{},"headers":[],"relativePath":"journal/march.md","filePath":"journal/march.md","lastUpdated":1690561590000}'),r={name:"journal/march.md"};function i(c,a,n,h,p,_){return l(),o("div",null,a[0]||(a[0]=[t('<h1 id="_3月1日" tabindex="-1">3月1日 <a class="header-anchor" href="#_3月1日" aria-label="Permalink to &quot;3月1日&quot;">​</a></h1><blockquote><p>今日学到一个新词。<br> 恩威并重：安抚和强制同时施行。</p></blockquote><p>新同事后端入职第一天，共事交流一天起来还是有点艰难的，如果我这个人对这个世界的判断是正确的话，那么他的情商应该是不太高的。一般来说，如果第一天合作就会出现问题，那么后面的日子也终究会因为这个问题而愤然离职，we will see。</p><h1 id="_3月2日" tabindex="-1">3月2日 <a class="header-anchor" href="#_3月2日" aria-label="Permalink to &quot;3月2日&quot;">​</a></h1><blockquote><p>忙碌起来才会忘记痛苦吧</p></blockquote><p>3月15之前要急着上线公司项目，好在换来了一个能力还不错的后端，预期说是不错，倒不如说是也凑合，因为已经不能要求更多了，他做过7个项目，大抵也算运用成熟，只是他目前还是个比较自负的人。<br> 早上，前公司的财务帮我整理一些材料，以便能使我去申请大学生就业基层补贴，而之前一起创业的伙伴也推荐了个周末兼职授课的活儿，meanwhile，昨晚还接了个朋友的外包。<br> 今年还是希望忙碌一点，我已经不年轻了吧</p><h1 id="_3月3日" tabindex="-1">3月3日 <a class="header-anchor" href="#_3月3日" aria-label="Permalink to &quot;3月3日&quot;">​</a></h1><blockquote><p>后端讲究数据结构，前端讲究样式和实用性</p></blockquote><p>即使剩下不到13天，后端也仍然要重写后端架构，以“15号就要交付项目”的结果来看，这个决定是毁灭性的，但我倒要看看后端能整出什么新花样。</p><h1 id="_3月6日" tabindex="-1">3月6日 <a class="header-anchor" href="#_3月6日" aria-label="Permalink to &quot;3月6日&quot;">​</a></h1><blockquote><p>能够一眼看到头的日子，终究会以悲剧收场</p></blockquote><p>做程序这件事情，本身是没有挑战性的，但是他也是实实在在的在耗费你的精力，这点时间别人在赚更多的钱，而我却在为了几块外卖费纠结半天</p><h1 id="_3月9日" tabindex="-1">3月9日 <a class="header-anchor" href="#_3月9日" aria-label="Permalink to &quot;3月9日&quot;">​</a></h1><blockquote><p>近日心智负担加大，没来得及更新内容</p></blockquote><p>赶工期的日子让我有点疲惫、新来的后端为了赶工期舍弃了很多业务细节使我不得不花更多的精力去跟他沟通，而在开发系统后台页面上面，有些函数写的不尽人意，让我捉襟见肘，希望后续有时间再好好整理一下过去实现业务的思路吧。</p><h1 id="_3月13日" tabindex="-1">3月13日 <a class="header-anchor" href="#_3月13日" aria-label="Permalink to &quot;3月13日&quot;">​</a></h1><blockquote><p>讲话的艺术，真的很重要</p></blockquote><p>后端在短短半个月的时间干了什么事情：</p><ol><li>重构了后端代码</li><li>重写了暴露接口的格式</li><li>二次重写了暴露接口的格式<br> 真的要救命</li></ol>',19)]))}const s=e(r,[["render",i]]);export{d as __pageData,s as default};
